const GalleryScroll = (props) => {
    const output = props.elements.map(el => (
        <div className="galleryElement">
            <div className="pic"></div>
            <h2 className="name">{el.name}</h2>
            <p className="price">{el.sizes.medium.price}</p>
        </div>
    ))
    return <div className="galleryContainer">{output}</div>;
};

export default GalleryScroll;
